import { createHash } from 'crypto';
import mongodb from 'mongodb';

const { MongoClient, ObjectId } = mongodb;

class DBClient {
  constructor() {
    const host = process.env.DB_HOST || 'localhost';
    const port = process.env.DB_PORT || '27017';
    const database = process.env.DB_DATABASE || 'files_manager';

    // Cration d'une instance de MongoClient pour se connecter  la base de donnes MongoDB
    this.mongoClient = new MongoClient(`mongodb://${host}:${port}/${database}`, { useUnifiedTopology: true });
    this.isConnectionAlive = false;

    // Connexion  MongoDB et mise  jour de l'tat de la connexion
    this.mongoClient.connect().then(() => {
      this.isConnectionAlive = true;
    });
  }

  isAlive() {
    return this.isConnectionAlive;
  }

  // Mthode pour obtenir le nombre d'utilisateurs dans la collection 'users'
  async nbUsers() {
    if (!this.isAlive()) {
      return -1;
    }
    const collection = this.mongoClient.db().collection('users');
    const count = await collection.countDocuments();
    return count;
  }

  async nbFiles() {
    if (!this.isAlive()) {
      return -1;
    }
    const collection = this.mongoClient.db().collection('files');
